export const NavbarCSS = {
  appbar: {
    backgroundColor: "#304FA1",
    px: "50px",
    position: "sticky",
    top: 0,
  },

  image: {
    flex: 1,
    display: "flex",
    alignItems: "center",
    height: "120px",
    minWidth: "fit-content",
  },
  logoImage: { width: "clamp(100px, 25vw, 200px)", cursor: "pointer" },
};
